import React from 'react';
import ReactDOM from 'react-dom/client';
import "./style.css"
imp

function Navbar(){
  return(
    <div className="navbar">
        <div className="navbar--section1">
            <h1 className="navbar--section1__title">Udemy</h1>
        </div>
        <div className="navbar--section2">

            <input type="text" placeholder="Search for anything"></input>
        </div>
        <div className="navbar--section3">
            <p>Courses</p>
            <div className="navbar__selection">
                <p>My Learnings</p>
                <div className="My__learning">
                    <p>You havent purchased the course</p>
                </div>
            </div>
        </div>
    </div>
  )
}

function Container(){
  return(
    <div className="Categoriess">
        <p>Software Development</p>
        <p>IT & Software</p>
        <p>Business Development</p>
        <p>Personal Development</p>
        <p>Marketing</p>
        <p>Design</p>
    </div>
  )
}

function Saleimg(){
  return(
    <div className="Sale-img">
        <img src="./images'/newsaleimg.jpg" alt="salesimg"></img>
        <div class="sale__offer">
            <h2>Flash sale ends with in 24hrs</h2>
            <p>Get  certified Courses at 499 with top certified mentors. grab <br></br>this opportunities learn and become pro in any of the courses.</p>
        </div>
    </div>
  )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <div>
    <Navbar></Navbar>
    <Container></Container>
    <Saleimg></Saleimg>
  </div>
);
